import React from "react";

import '../Css/styles.css'; 
import ButtonGroup from '../elements/ButtonGroup';
import Button from '../elements/Button';
import classNames from 'classnames';
import DataService from '../../service/DataService'; 
import MyntInvestLogo from '../../assets/images/MyntInvest.png';
import 'bootstrap/dist/css/bootstrap.min.css'; 
import UploadService from "../../service/file-upload.service";
import Moment from 'moment';
import $ from "jquery";
const formatDate = Moment("12/09/2002").format('YYYY-MM-DD')//2002-12-09
const extractFilename = (path) => {
  const pathArray = path.split("/");
  const lastIndex = pathArray.length - 1;
  return pathArray[lastIndex];
};

const tilesClasses = classNames(
    'tiles-wrap center-content',
  ); 

  const current = new Date();
  const date = `${current.getFullYear()}-${current.getMonth()+1}-${current.getDate()}`;//mysql insert date format
   

class Investor_Signup extends React.Component {
 
    constructor() {
    super();
    this.state = { 
      invSignAllDets: [],
      currentinvSign: null,
      currentinvSignIndex: -1,
      input: {},
      errors: {},
      ID: null,
      MTUSER_ID: null,
      EMAIL: null,
      MODULE: null,
      ROLE:null,
      NATIONALITY: "",
      STATUS: "",
      COMMENTS: "",
      DESCRIPTION: "",
      CREATED_USER: "",
      CREATED_DATE: "",
      MODIFIED_USER: "",
      MODIFIED_DATE: "",
      RAISE_UPLOAD_DOC_NAME: "",
      fileInfos: [],
    };
     
    this.saveNationality = this.saveNationality.bind(this);  
    this.handleChange = this.handleChange.bind(this); 
  }
   
  handleChange(event) {
    event.preventDefault();
    let input = this.state.input;
    input[event.target.name] = event.target.value;
   
    this.setState({ 
      ID: null,
      MTUSER_ID:sessionStorage.getItem("sessUserId"),
      EMAIL: sessionStorage.getItem("sessEmail"),
      MODULE: sessionStorage.getItem("sessModule"),
      ROLE:sessionStorage.getItem("sessRole"),
      NATIONALITY:this.state.input.investorNationality,
      STATUS: "Active",
      COMMENTS: "",
      CREATED_DATE: date,
      CREATED_USER: sessionStorage.getItem("sessFirstname"),
      DESCRIPTION: "Logged User",
      MODIFIED_DATE: date,
      MODIFIED_USER: sessionStorage.getItem("sessFirstname"),
       
    });




  }
     
    
   saveNationality(event) {
    event.preventDefault(); 
    if(this.validateNationality()){
    var data = {
      ID: null,
      MTUSER_ID:sessionStorage.getItem("sessUserId"),
      EMAIL: sessionStorage.getItem("sessEmail"),
      MODULE: sessionStorage.getItem("sessModule"),
      ROLE:sessionStorage.getItem("sessRole"),
      NATIONALITY:this.state.input.investorNationality,
      STATUS: "Active",
      COMMENTS: "", 
      DESCRIPTION: "Logged User",
      CREATED_DATE: date,
      CREATED_USER: sessionStorage.getItem("sessFirstname"),
      MODIFIED_DATE: date,
      MODIFIED_USER: sessionStorage.getItem("sessFirstname"),
       
    };

    console.log(data);


   
    DataService.create("/inv_nationality",data)
      .then(response => {  
        console.log("inside");
        window.showLoader();
        window.showAlert("Investor Nationality updated", "/Founders"); 
         
        
      })
      .catch(e => {
        window.showLoader(); 
        console.log(e);
        window.showAlert("User Not registered","/Signup");
        // window.location.href = "/Signup";//to redirect to normal links
      });
    }
  }
 
    validateNationality(){
      let input = this.state.input;
      let errors = {};
      let isValid = true;
   
      if (!input["firstname"]) {
        isValid = false;
        errors["firstname"] = "Please enter your firstname.";
        $("#firstname").focus();
      }
   
  
      if (!input["lastname"]) {
        isValid = false;
        errors["lastname"] = "Please enter your lastname.";
        $("#lastname").focus();
      }
  
      
      
      if (!input["email"]) {
        isValid = false;
        errors["email"] = "Please enter your email Address.";
        $("#email").focus();
      }
  
       

      if (!input["schoolname"]) {
        isValid = false;
        errors["schoolname"] = "Please enter your schoolname.";
        $("#schoolname").focus();
      }
  
      // if (typeof input["schoolname"] !== "undefined") {
      //   const re = /^\S*$/;
      //   if(input["schoolname"].length < 6 || !re.test(input["schoolname"])){
      //       isValid = false;
      //       errors["schoolname"] = "Please enter valid schoolname.";
      //   }
      // }

      if (!input["password"]) {
        isValid = false;
        errors["password"] = "Please enter your password.";
        $("#password").focus();
      }
  
      if (!input["confirm_password"]) {
        isValid = false;
        errors["confirm_password"] = "Please Re-enter your password.";
        $("#confirm_password").focus();
      }
  
      if (typeof input["password"] !== "undefined") {
        if(input["password"].length < 6){
            isValid = false;
            errors["password"] = "Please add at least 6 charachter.";
            $("#password").focus();
        }
      }
  
      if (typeof input["password"] !== "undefined" && typeof input["confirm_password"] !== "undefined") {
          
        if (input["password"] != input["confirm_password"]) {
          isValid = false;
          errors["password"] = "Passwords don't match.";
          $("#password").focus();
        }
      }
  

      if (!document.getElementById("agreechk").checked) {
        isValid = false;
        errors["agreechk"] = "Please you agree to our Terms, Privacy Policy and Cookies Policy. "; 
        $("#agreechk").focus();
      }


      this.setState({
        errors: errors
      });
  
      return isValid;
  }
     
  render() {
    return (
